int 
icub_air_chkbnum(int routine,
    int bnum)
{

    if ((bnum < -1) || (bnum > 38)) {
        icub_air_seterr(routine,15);
        return 1;
    }
    return 0;
}
int 
icub_air_chkjnum(int routine,
    int jnum)
{

    if ((jnum < 0) || (jnum > 38)) {
        icub_air_seterr(routine,16);
        return 1;
    }
    return 0;
}
int 
icub_air_chkucnum(int routine,
    int ucnum)
{

    if ((ucnum < 0) || (ucnum > -1)) {
        icub_air_seterr(routine,21);
        return 1;
    }
    return 0;
}
int 
icub_air_chkjaxis(int routine,
    int jnum,
    int axnum)
{
    int maxax;

    if (icub_air_chkjnum(routine,jnum) != 0) {
        return 1;
    }
    if ((axnum < 0) || (axnum > 6)) {
        icub_air_seterr(routine,17);
        return 1;
    }
    maxax = njntdof[jnum]-1;
    if ((jtype[jnum] == 4) || (jtype[jnum] == 6) || (jtype[jnum] == 21)) {
        maxax = maxax+1;
    }
    if (axnum > maxax) {
        icub_air_seterr(routine,18);
        return 1;
    }
    return 0;
}
int 
icub_air_chkjpin(int routine,
    int jnum,
    int pinno)
{
    int maxax,pinok;

    if (icub_air_chkjnum(routine,jnum) != 0) {
        return 1;
    }
    if ((pinno < 0) || (pinno > 5)) {
        icub_air_seterr(routine,17);
        return 1;
    }
    if (njntdof[jnum] >= 3) {
        maxax = 2;
    } else {
        maxax = njntdof[jnum]-1;
    }
    if (jtype[jnum] == 4) {
        maxax = -1;
    }
    if (jtype[jnum] == 7) {
        maxax = 0;
    }
    pinok = 0;
    if (pinno <= maxax) {
        pinok = 1;
    }
    if (pinok == 0) {
        icub_air_seterr(routine,18);
        return 1;
    }
    return 0;
}
int 
icub_air_indx(int joint,
    int axis)
{
    int offs,gotit;

    if (icub_air_chkjaxis(36,joint,axis) != 0) {
        return 0;
    }
    gotit = 0;
    if (jtype[joint] == 4) {
        if (axis == 3) {
            offs = ballq[joint];
            gotit = 1;
        }
    } else {
        if ((jtype[joint] == 6) || (jtype[joint] == 21)) {
            if (axis == 6) {
                offs = ballq[joint];
                gotit = 1;
            }
        }
    }
    if (gotit == 0) {
        offs = firstq[joint]+axis;
    }
    return offs;
}

